import Layout from "../components/Layout";

const about = props => {
  return (
    <Layout>
      <div>
        <h1>About.js</h1>
      </div>
    </Layout>
  );
};

about.getInitialProps = async props => {
  console.log(props);

  let from = "client";

  if (props.req) {
    from = "server";
  }

  return { a: 123, b: 234, from: from };
};

export default about;
